  [],\n\t\"revision_timestamp\": \"2016-05-31T01:08:23.679029\",\n\t\"name\": \"alaska-steller-sea-lion-habitat-model-satellite-telemetry-and-environmental-data-2000-2012\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The at-sea habitat use of Steller sea lions
  was modeled from location and dive behavior data obtained from the deployment of
  satellite-linked telemetry tags on sea lions captured in Alaska. This habitat model
  was considered in the 2015 review of Critical Habitat designated for Steller sea
  lions under the U.S. Endangered Species Act. This data set includes GPS location
  data collected from nine adult female Steller sea lions captured from 2010 to 2012
  in the western Aleutian Islands (n=3), central Aleutian Islands (n=3), and Southeast
  Alaska (n=3), and Argos location data collected for 86 juvenile Steller sea lions
  captured and tagged with satellite depth recorders in the central (n=20) and eastern
  (n=27) Aleutian Islands and central Gulf of Alaska (n=39) from 2000-2005. To assess
  habitat use and effects on movements and dive behavior, predicted spatial locations
  based on processed data were linked with associated dive behavior, then compared
  with dynamic and static environmental variables and other covariates.n\",\n\t\"license_title\":
